    state = { clicked: false }

    handleClick = () => {
        this.setState({ clicked: !this.state.clicked })
    }
    render() {
        return (
            <div className='/'>

                <h1>Main</h1>
                <img src={loslagos_1} />
            </div>
        );
    }

}

export default Home;
